import React, { useState } from "react";
import axios from "axios";
import "bootstrap/dist/css/bootstrap.min.css";

const App = () => {
  const [files, setFiles] = useState([]);
  const [file, setFile] = useState(null);
  const [jobDesc, setJobDesc] = useState("");
  const [template, setTemplate] = useState("");
  const [loading, setLoading] = useState(false);
  const [results, setResults] = useState([]);  // To store match scores

  const jobTemplates = [
    "Software Engineer - Java, Python, SQL",
    "Data Analyst - Python, SQL, Tableau",
    "Frontend Developer - React, JavaScript, CSS",
    "AI Engineer - Python, Deep Learning, NLP, TensorFlow",
    "Cloud Engineer - AWS, Azure, Google Cloud",
    "VLSI Engineer - Verilog, VHDL, Python",
    "Cyber Security Engineer - Python, C, C++,",
    "DevOps Engineer - Python, Ansible, Jenkins",
    "Full Stack Developer - Python, JavaScript, CSS,",
    "Network Engineer - Python, C, C++,",
    "Python Developer - Python, SQL,",
    "C++ Developer - C++, Python, SQL",
    "IoT Engineer - C, C++, Python, MQTT, Raspberry Pi, Arduino",
    "DevOps Engineer - Docker, Kubernetes, Jenkins, Ansible, Terraform",
    "Blockchain Developer - Solidity, Ethereum, Hyperledger, Smart Contracts",
    "Game Developer - C++, C#, Unity, Unreal Engine",
    "Networking Engineer - CCNA, TCP/IP, Routing, Switching, Firewalls",
    "AI Engineer - Python, Deep Learning, NLP, Computer Vision, TensorFlow",
    "AR/VR Developer - Unity, Unreal Engine, C#, C++, OpenXR",
    "Mobile App Developer - Java, Kotlin, Swift, Flutter, React Native",
    "Software Engineer - Java, C++, Python, SQL, Software Development Lifecycle",
    "Database Administrator - MySQL, PostgreSQL, MongoDB, Oracle, SQL Server",
    "Electrical Engineer - MATLAB, Simulink, Circuit Design, Embedded C",
    "Mechanical Engineer - SolidWorks, AutoCAD, MATLAB, ANSYS",
    "Civil Engineer - AutoCAD, Revit, STAAD.Pro, SAP2000",
  ];

  const handleFileChange = (event) => {
    setFiles([...event.target.files]);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    if (files.length === 0 || (!jobDesc && !template)) {
      alert("Please upload at least one resume and provide a job description.");
      return;
    }

    setLoading(true);

    // Simulate match scores for demo purposes
    const mockResults = files.map((file) => ({
      name: file.name,
      score: Math.floor(Math.random() * 100),  // Simulating scores (0-100%)
    }));

    setTimeout(() => {
      setResults(mockResults);
      setLoading(false);
    }, 1000);
  };

  return (
    <div className="container mt-5">
      <h1 className="text-center">Charlie For You</h1>

      {/* File Upload */}
      <div className="form-group">
        <label htmlFor="resume"><strong>Upload Resumes (PDF)</strong></label>
        <input
          type="file"
          id="resume"
          accept=".pdf"
          multiple
          className="form-control"
          onChange={handleFileChange}
        />
      </div>

      {/* Job Description Dropdown */}
      <div className="form-group mt-3">
        <label htmlFor="template"><strong>Job Description</strong></label>
        <select
          id="template"
          className="form-control"
          onChange={(e) => setTemplate(e.target.value)}
        >
          <option value="">Select a Job Template</option>
          {jobTemplates.map((job, index) => (
            <option key={index} value={job}>
              {job}
            </option>
          ))}
        </select>
      </div>

      {/* Manual Job Description */}
      <div className="form-group mt-3">
        <textarea
          className="form-control"
          placeholder="Or enter manually..."
          value={jobDesc}
          onChange={(e) => setJobDesc(e.target.value)}
        />
      </div>

      {/* Submit Button */}
      <div className="text-center mt-4">
        <button className="btn btn-primary" onClick={handleSubmit}>
          {loading ? "Processing..." : "Submit"}
        </button>
      </div>

      {/* Display Results */}
      <div className="mt-5">
        <h4>Shortlisted Resumes</h4>
        {results.length > 0 ? (
          <ul className="list-group">
            {results.map((result, index) => (
              <li key={index} className="list-group-item">
                <strong>{result.name}</strong> - Match Score: {result.score}%
                {result.score < 50 ? (
                  <span className="text-danger"> — Sorry, need improvement in your resume.</span>
                ) : (
                  <span className="text-success"> — Good match!</span>
                )}
              </li>
            ))}
          </ul>
        ) : (
          <p>No results yet. Submit resumes to view matches.</p>
        )}
      </div>
    </div>
  );
};

export default App;
